import * as React from 'react';
import Button from '@mui/material/Button';
import ButtonGroup from '@mui/material/ButtonGroup';
import CssBaseline from '@mui/material/CssBaseline';
import { useState } from "react";


const roundedButton = {
  borderRadius: 55,
  minWidth: '128px'
}
const bottonContainer = {
  width:180,
  justifyContent: 'center',
  alignItems: 'center',
}

export default function BuySellButtons() {
  const [active, setActive] = useState("buy");
 
  const handleClick = (event: { target: { id: React.SetStateAction<string>; }; }) => {
    setActive(event.target.id);
    
  }

  const roundedButtonBuy = {
    borderRadius: 55,
    minWidth: '128px',
    color: active === "buy" ? 'white': '',
    backgroundColor:active === "buy" ? "#454545": '#222222',
  }
  const roundedButtonSell = {
    borderRadius: 55,
    minWidth: '128px',
    color: active === "sell" ? 'white': '',
    backgroundColor:active === "sell" ? "#454545": '#222222',
  }

const [enabled, setEnabled] = useState(0);

  return (
        <ButtonGroup sx={bottonContainer} variant="contained" aria-label="outlined primary button group">
            <Button 
              sx={ roundedButtonBuy } 
              onClick={(e)=>handleClick(e as any)}
              
              id={"buy"}
            >
              Buy
            </Button>

            <Button sx={ roundedButtonSell } 
              onClick={(e)=>handleClick(e as any)}
              id={"sell"}
            >
              Sell
            </Button>
        </ButtonGroup>
  );
}
